import 'bootstrap/dist/css/bootstrap.min.css';
import { Container , Row, Col, Image, Button  } from 'react-bootstrap';
import classes from './Reservation.module.css';

import book from "../../assets/book.png";




const Reservation = () => {
    return (
        <div className={classes.diveder}>

            <Container >
                <Row>
                    <Col>
                        <div className={classes.reservation_card}>

                            <Image src={book} fluid className={classes.reservation_card_img}/>

                            <h1>Book a Table</h1>


                        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quis pariatur obcaecati reiciendis maxime fugit qui, aliquam, enim commodi mollitia est totam impedit vero? Amet alias veniam mollitia earum, laboriosam repudiandae?</p>
                        </div>

                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Reservation
